import {urlOfImages} from '../images';
const Social = () => {
    return(
        <div className="w-auto">
            <div>
            <button class="bg-white-500 border border-black text-black py-2 px-4 rounded">
                <i src={urlOfImages.google} ></i>Log in With Google
                </button>
            </div>
            <div>
            <button class="bg-blue-700 border text-white py-2 px-4 rounded">
                Log in With Facebook
                </button>
            </div>
            <div>
            <button class="bg-gray-800 border text-white py-2 px-4 rounded">
                Log in With Github
                </button>                
            </div>
        </div>
    );
};


export default Social;
